public createBullet(text: string): Paragraph {
  return new Paragraph({
    text: text,
    bullet: {
      level: 1
    }
  });
}


public createInstitutionHeader(
  institutionName: string,
  dateText: string
): Paragraph {
  return new Paragraph({
    thematicBreak: true,
    spacing:{
      before:300,
    },
    tabStops: [
      {
        type: TabStopType.RIGHT,
        position: 6500
      },

    ],
    children: [
      new TextRun({
        text: institutionName,
        bold: true
      }),
      new TextRun({
        text: `\t${dateText}`,
        bold: true
      }),
    ]
  });
}

